BEGIN TRANSACTION;
DROP TABLE IF EXISTS "Department";
CREATE TABLE IF NOT EXISTS "Department" (
	"name"	INTEGER UNIQUE,
	"description"	INTEGER,
	"department_id"	INTEGER,
	PRIMARY KEY("department_id" AUTOINCREMENT)
);
DROP TABLE IF EXISTS "gp_time_off";
CREATE TABLE IF NOT EXISTS "gp_time_off" (
	"startTime"	NUMERIC,
	"endTime"	NUMERIC,
	"time_off_id"	INTEGER,
	"gp_id"	INTEGER,
	PRIMARY KEY("time_off_id" AUTOINCREMENT),
	FOREIGN KEY("gp_id") REFERENCES "Users"("userId")
);
DROP TABLE IF EXISTS "Specialists";
CREATE TABLE IF NOT EXISTS "Specialists" (
	"firstName"	TEXT,
	"lastName"	TEXT,
	"hospital"	TEXT,
	"specialist_id"	INTEGER,
	"department_id"	INTEGER,
	PRIMARY KEY("specialist_id" AUTOINCREMENT),
	FOREIGN KEY("department_id") REFERENCES "Department"("department_id")
);
DROP TABLE IF EXISTS "Appointment";
CREATE TABLE IF NOT EXISTS "Appointment" (
	"is_confirmed"	INTEGER DEFAULT 0,
	"is_rejected"	INTEGER DEFAULT 0,
	"appointment_id"	INTEGER,
	"patient_id"	INTEGER,
	"gp_id"	INTEGER,
	"slot_id"	INTEGER,
	"reason"	TEXT DEFAULT 'None',
	"referred_specialist_id"	INTEGER,
	PRIMARY KEY("appointment_id" AUTOINCREMENT),
	FOREIGN KEY("patient_id") REFERENCES "Users"("userId"),
	FOREIGN KEY("slot_id") REFERENCES "Old Slots"("slot_id"),
	FOREIGN KEY("referred_specialist_id") REFERENCES "Specialists",
	FOREIGN KEY("gp_id") REFERENCES "Users"("userId")
);
DROP TABLE IF EXISTS "Users";
CREATE TABLE IF NOT EXISTS "Users" (
	"firstName"	TEXT,
	"lastName"	TEXT,
	"email"	TEXT UNIQUE,
	"password"	TEXT,
	"accountType"	TEXT,
	"is_registered"	INTEGER DEFAULT 0,
	"is_active"	INTEGER DEFAULT 0,
	"signUpDate"	NUMERIC,
	"userId"	INTEGER,
	"date_of_birth"	NUMERIC,
	PRIMARY KEY("userId")
);
DROP TABLE IF EXISTS "Slots";
CREATE TABLE IF NOT EXISTS "Slots" (
	"startTime"	NUMERIC,
	"endTime"	NUMERIC,
	"slot_id"	INTEGER,
	PRIMARY KEY("slot_id")
);
DROP TABLE IF EXISTS "Prescription";
CREATE TABLE IF NOT EXISTS "Prescription" (
	"medicine_name"	TEXT,
	"treatment_description"	TEXT,
	"pres_frequency_in_days"	NUMERIC,
	"startDate"	TEXT DEFAULT CURRENT_TIMESTAMP,
	"expiryDate"	TEXT,
	"prescription_id"	INTEGER,
	"appointment_id"	INTEGER,
	PRIMARY KEY("prescription_id" AUTOINCREMENT),
	FOREIGN KEY("appointment_id") REFERENCES "Appointment"("appointment_id")
);
COMMIT;



;

